import Head from '../head.component';
import Header from '../header.component';
import Footer from '../footer.component';

const Product = () => {
    return(
        <>
        <Head/>
        <main className="container-fluid">
            <Header/>
            <section className="row section-product">
                <h1>producto</h1>
            </section>
            <Footer/>
        </main>
        </>
    )
}

export default Product;
